import React, {useState, useEffect} from "react";
import {Link, useNavigate, useParams} from 'react-router-dom';
import { useDispatch, useSelector } from "react-redux";
import { getObrasSociales, editCliente, getClienteById } from "../redux/actions";

export default function ClientEdit(){

  const dispatch = useDispatch();
  const { id } = useParams();
  const navigate = useNavigate();
  const obrasSociales = useSelector((state) => state.obrasSociales);
  const [input, setInput] = useState({
    nombre: "",
    apellido: "",
    puntos: 0,
    dni: "",
    numeroDeAfiliado: "",
    direccion: "",
    telefono: "",
    obraSocial: [],
  });

  useEffect(()=>{
    dispatch(getClienteById(id));
    dispatch(getObrasSociales());
  }, [dispatch, id]);

  const cliente = useSelector((state) => state.clientes);

useEffect(() => {
  if (cliente && cliente.length > 0) {
    setInput({
      nombre: cliente[0].nombre,
      apellido: cliente[0].apellido,
      puntos: cliente[0].puntos,
      dni: cliente[0].dni,
      numeroDeAfiliado: cliente[0].numeroDeAfiliado,
      direccion: cliente[0].direccion,
      telefono: cliente[0].telefono,
      obraSocial: cliente[0].ObraSociales?.map(os => os.nombre) || [],
    });
  }
}, [cliente]);

const handleChange = (e) => {
  setInput({
    ...input,
    [e.target.name]: e.target.value,
  });
};

const handleSelectChange = (e) => {
  const options = e.target.options;
  const selectedValues = [];
  for (let i = 0; i < options.length; i++) {
    if (options[i].selected) {
      selectedValues.push(options[i].value);
    }
  }
  setInput({
    ...input,
    obraSocial: selectedValues,
  });
};

const handleSubmit = (e) => {
  e.preventDefault();
  dispatch(editCliente(input, id));
  alert("Cliente actualizado con Ã©xito.");
  navigate("/home");
};

  return (
    <div>
    <h1>EDITAR CLIENTE</h1>
    <form onSubmit={(e) => handleSubmit(e)}>
      <div>
        <label>Nombre:</label>
        <input
          type="text"
          value={input.nombre}
          onChange={(e) => handleChange(e)}
          name="nombre"
        />
      </div>
      <div>
        <label>Apellido:</label>
        <input
          type="text"
          value={input.apellido}
          onChange={(e) => handleChange(e)}
          name="apellido"
        />
      </div>
      <div>
        <label>Puntos:</label>
        <input
          type="number"
          value={input.puntos}
          onChange={(e) => handleChange(e)}
          name="puntos"
        />
      </div>
      <div>
        <label>DNI:</label>
        <input
          type="text"
          value={input.dni}
          onChange={(e) => handleChange(e)}
          name="dni"
        />
      </div>
      <div>
        <label>NÃºmero de Afiliado:</label>
        <input
          type="text"
          value={input.numeroDeAfiliado}
          onChange={(e) => handleChange(e)}
          name="numeroDeAfiliado"
        />
      </div>
      <div>
        <label>DirecciÃ³n:</label>
        <input
          type="text"
          value={input.direccion}
          onChange={(e) => handleChange(e)}
          name="direccion"
        />
      </div>
      <div>
        <label>TelÃ©fono:</label>
        <input
          type="text"
          value={input.telefono}
          onChange={(e) => handleChange(e)}
          name="telefono"
        />
      </div>
      <div>
        <label>Obra Social:</label>
        <select
          multiple
          value={input.obraSocial}
          onChange={(e) => handleSelectChange(e)}
        >
          {obrasSociales.map((obra) => (
            <option key={obra.id} value={obra.nombre}>
              {obra.nombre}
            </option>
          ))}
        </select>
      </div>
      <button type="submit">Guardar Cambios</button>
    </form>
    <Link to="/home">
      <button>Cancelar</button>
    </Link>
  </div>
  )
}
